import React, { Component } from "react";
import { Route } from "react-router-dom";
import DetailViewAT1  from "../components/AT - Form/DetailViewAT1";
import ViewAT2 from "../components/AT - Form/DetailViewAT2";
import DetailViewAT3  from "../components/AT - Form/DetailViewAT3";
import  DetailViewAT4  from "../components/AT - Form/DetailViewAT4";
import ViewAT5 from "../components/AT - Form/DetailViewAT5";
import ViewAT7, { DetailViewAT7 } from "../components/AT - Form/DetailViewAT7";
import ViewAT8 from "../components/AT - Form/DetailViewAT8";
export class DetailAT extends Component {
  render() {
    return (
      <div>
        <Route
          path={process.env.PUBLIC_URL + "/DetailViewAT1/:id"}
          exact={true}
          component={DetailViewAT1}
        />
        <Route
          path={process.env.PUBLIC_URL + "/ViewDetailAT2/:id"}
          exact={true}
          component={ViewAT2}
        />
          <Route
          path={process.env.PUBLIC_URL + "/DetailViewAT3/:id"}
          exact={true}
          component={DetailViewAT3}
        />
          <Route
          path={process.env.PUBLIC_URL + "/DetailViewAT4/:id"}
          exact={true}
          component={DetailViewAT4}
        />
         <Route
          path={process.env.PUBLIC_URL + "/ViewDetailAT5/:id"}
          exact={true}
          component={ViewAT5}
        />
        <Route
          path={process.env.PUBLIC_URL + "/DeetailViewAT7/:id"}
          exact={true}
          component={DetailViewAT7}
        />
         <Route
          path={process.env.PUBLIC_URL + "/ViewDetailAT8/:id"}
          exact={true}
          component={ViewAT8}
        />
      </div>
    );
  }
}

export default DetailAT;
